import { Container } from 'react-bootstrap';
import MenuItem from './MenuItem';

const Menu = (props) => {

    return (
        <Container style={{ height: "100%", border: "1px solid white", backgroundColor:"white" }}>
            {
                props.restobject.map((menuItem, index) => {
                <MenuItem item={menuItem} key={index} />
} )
            }
        </Container>
    )
}

export default Menu;
